pragma solidity ^0.5.17;

import './libraries/TransferHelper.sol';
import './libraries/UniswapV2Library.sol';

import './interfaces/IUniswapV2Router02.sol';
import './interfaces/IUniswapV2Factory.sol';
import './interfaces/IERC20.sol';
import './interfaces/IWATP.sol';

contract UniswapV2Router02 is IUniswapV2Router02 {
    //watp
    address public factory;
    address public WATP;
    //:
    modifier ensure(uint256 deadline) {
        // solium-disable-next-line security/no-block-members
        require(deadline >= block.timestamp, "UniswapV2Router: EXPIRED");
        _;
    }

    //:watp
    constructor(address _factory, address _WATP) public {
        factory = _factory;
        WATP = _WATP;
    }

    //
    function() external payable {
        //watp
        assert(msg.sender == WATP); // only accept ATP via fallback from the WATP contract
    }

    // **** ADD LIQUIDITY ****
    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param amountADesired A
     * @param amountBDesired B
     * @param amountAMin A
     * @param amountBMin B
     * @return amountA   A
     * @return amountB   B
     */
    function _addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin
    ) private returns (uint256 amountA, uint256 amountB) {
        // create the pair if it doesn't exist yet
        //,
        if (IUniswapV2Factory(factory).getPair(tokenA, tokenB) == address(0)) {
            IUniswapV2Factory(factory).createPair(tokenA, tokenB);
        }
        //reserve{A,B}
        (uint256 reserveA, uint256 reserveB) = UniswapV2Library.getReserves(
            factory,
            tokenA,
            tokenB
        );
        //reserve{A,B}==0
        if (reserveA == 0 && reserveB == 0) {
            //amount{A,B} = A,B
            (amountA, amountB) = (amountADesired, amountBDesired);
        } else {
            //B = A * B / A
            uint256 amountBOptimal = UniswapV2Library.quote(
                amountADesired,
                reserveA,
                reserveB
            );
            //B <= B
            if (amountBOptimal <= amountBDesired) {
                //B >= B
                require(
                    amountBOptimal >= amountBMin,
                    "UniswapV2Router: INSUFFICIENT_B_AMOUNT"
                );
                //amount{A,B} = A, B
                (amountA, amountB) = (amountADesired, amountBOptimal);
            } else {
                //A = A * A / B
                uint256 amountAOptimal = UniswapV2Library.quote(
                    amountBDesired,
                    reserveB,
                    reserveA
                );
                //A <= A
                assert(amountAOptimal <= amountADesired);
                //A >= A
                require(
                    amountAOptimal >= amountAMin,
                    "UniswapV2Router: INSUFFICIENT_A_AMOUNT"
                );
                //amount{A,B} = A, B
                (amountA, amountB) = (amountAOptimal, amountBDesired);
            }
        }
    }

    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param amountADesired A
     * @param amountBDesired B
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @return amountA   A
     * @return amountB   B
     * @return liquidity   
     */
    function addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    )
        external
        ensure(deadline)
        returns (
            uint256 amountA,
            uint256 amountB,
            uint256 liquidity
        )
    {
        //A,B
        (amountA, amountB) = _addLiquidity(
            tokenA,
            tokenB,
            amountADesired,
            amountBDesired,
            amountAMin,
            amountBMin
        );
        //TokenA,TokenB,`pair`
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        //amountAtokenAmsg.senderpair
        TransferHelper.safeTransferFrom(tokenA, msg.sender, pair, amountA);
        //amountBtokenBmsg.senderpair
        TransferHelper.safeTransferFrom(tokenB, msg.sender, pair, amountB);
        // = pairto
        liquidity = IUniswapV2Pair(pair).mint(to);
    }

    /**
     * @dev ATP
     * @param token token
     * @param amountTokenDesired Token
     * @param amountTokenMin Token
     * @param amountATPMin ATP
     * @param to to
     * @param deadline 
     * @return amountToken   Token
     * @return amountATP   ATP
     * @return liquidity   
     */
    function addLiquidityATP(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountATPMin,
        address to,
        uint256 deadline
    )
        external
        payable
        ensure(deadline)
        returns (
            uint256 amountToken,
            uint256 amountATP,
            uint256 liquidity
        )
    {
        //Token,ATP
        (amountToken, amountATP) = _addLiquidity(
            token,
            WATP,
            amountTokenDesired,
            msg.value,
            amountTokenMin,
            amountATPMin
        );
        //Token,WATP,`pair`
        address pair = UniswapV2Library.pairFor(factory, token, WATP);
        //`Token`tokenmsg.sender`pair`
        TransferHelper.safeTransferFrom(token, msg.sender, pair, amountToken);
        //`WATP``ATP`
        IWATP(WATP).deposit.value(amountATP)();
        //`ATP``WATP`token`pair`
        assert(IWATP(WATP).transfer(pair, amountATP));
        // = pair`to`
        liquidity = IUniswapV2Pair(pair).mint(to);
        //``>`ATP` ``-`ATP`
        if (msg.value > amountATP)
            TransferHelper.safeTransferATP(msg.sender, msg.value - amountATP); // refund dust atp, if any
    }

    // **** REMOVE LIQUIDITY ****
    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param liquidity 
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @return amountA   A
     * @return amountB   B
     */
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    ) public ensure(deadline) returns (uint256 amountA, uint256 amountB) {
        //TokenA,TokenBCREATE2
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        //pair()
        IUniswapV2Pair(pair).transferFrom(msg.sender, pair, liquidity); // send liquidity to pair
        //pair,0,1tokento
        (uint256 amount0, uint256 amount1) = IUniswapV2Pair(pair).burn(to);
        //tokenA,tokenB
        (address token0, ) = UniswapV2Library.sortTokens(tokenA, tokenB);
        //tokenAB
        (amountA, amountB) = tokenA == token0
            ? (amount0, amount1)
            : (amount1, amount0);
        //ABAB
        require(
            amountA >= amountAMin,
            "UniswapV2Router: INSUFFICIENT_A_AMOUNT"
        );
        require(
            amountB >= amountBMin,
            "UniswapV2Router: INSUFFICIENT_B_AMOUNT"
        );
    }

    /**
     * @dev ATP
     * @param token token
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountATPMin ATP
     * @param to to
     * @param deadline 
     * @return amountToken   token
     * @return amountATP   ATP
     */
    function removeLiquidityATP(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountATPMin,
        address to,
        uint256 deadline
    ) public ensure(deadline) returns (uint256 amountToken, uint256 amountATP) {
        //(token,ATP) = (token,WATP,,token,ATP,,)
        (amountToken, amountATP) = removeLiquidity(
            token,
            WATP,
            liquidity,
            amountTokenMin,
            amountATPMin,
            address(this),
            deadline
        );
        //tokentokento
        TransferHelper.safeTransfer(token, to, amountToken);
        //WATPATP
        IWATP(WATP).withdraw(amountATP);
        //ATPATPto
        TransferHelper.safeTransferATP(to, amountATP);
    }

    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param liquidity 
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @param approveMax 
     * @param v v
     * @param r r
     * @param s s
     * @return amountA   A
     * @return amountB   B
     */
    function removeLiquidityWithPermit(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountA, uint256 amountB) {
        //TokenA,TokenBCREATE2
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        //,valueuint256,
        uint256 value = approveMax ? uint256(-1) : liquidity;
        //pair(,,,,v,r,s)
        IUniswapV2Pair(pair).permit(
            msg.sender,
            address(this),
            value,
            deadline,
            v,
            r,
            s
        );
        //(A,B) = (tokenA,tokenB,,A,B,to,)
        (amountA, amountB) = removeLiquidity(
            tokenA,
            tokenB,
            liquidity,
            amountAMin,
            amountBMin,
            to,
            deadline
        );
    }

    /**
     * @dev ATP
     * @param token token
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountATPMin ATP
     * @param to to
     * @param deadline 
     * @param approveMax 
     * @param v v
     * @param r r
     * @param s s
     * @return amountToken   token
     * @return amountATP   ATP
     */
    function removeLiquidityATPWithPermit(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountATPMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountToken, uint256 amountATP) {
        //Token,WATPCREATE2
        address pair = UniswapV2Library.pairFor(factory, token, WATP);
        //,valueuint256,
        uint256 value = approveMax ? uint256(-1) : liquidity;
        //pair(,,,,v,r,s)
        IUniswapV2Pair(pair).permit(
            msg.sender,
            address(this),
            value,
            deadline,
            v,
            r,
            s
        );
        //(token,ATP) = ATP(token,,token,ATP,to,)
        (amountToken, amountATP) = removeLiquidityATP(
            token,
            liquidity,
            amountTokenMin,
            amountATPMin,
            to,
            deadline
        );
    }

    // **** SWAP ****
    /**
     * @dev 
     * @notice 
     * @param amounts 
     * @param path 
     * @param _to to
     */
    // requires the initial amount to have already been sent to the first pair
    function _swap(
        uint256[] memory amounts,
        address[] memory path,
        address _to
    ) private {
        //
        for (uint256 i; i < path.length - 1; i++) {
            //(,) = (,)
            (address input, address output) = (path[i], path[i + 1]);
            //token0 = (,)
            (address token0, ) = UniswapV2Library.sortTokens(input, output);
            // = 
            uint256 amountOut = amounts[i + 1];
            //(0,1) = ==token0 ? (0,) : (,0)
            (uint256 amount0Out, uint256 amount1Out) = input == token0
                ? (uint256(0), amountOut)
                : (amountOut, uint256(0));
            //to = i<-2 ? (,)pair : to
            address to = i < path.length - 2
                ? UniswapV2Library.pairFor(factory, output, path[i + 2])
                : _to;
            //(,)pair(0,1,to,0x00)
            IUniswapV2Pair(UniswapV2Library.pairFor(factory, input, output))
                .swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }

    /**
     * @dev tokentoken
     * @param amountIn 
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external ensure(deadline) returns (uint256[] memory amounts) {
        //  (( * 997 * Out) / (In * 1000 +  * 997))
        amounts = UniswapV2Library.getAmountsOut(factory, amountIn, path);
        //>=
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        //(,,to)
        _swap(amounts, path, to);
    }

    /**
     * @dev tokentoken
     * @param amountOut 
     * @param amountInMax 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external ensure(deadline) returns (uint256[] memory amounts) {
        //  ((In * Out * 1000) / (Out -  * 997) + 1)
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        //<=
        require(
            amounts[0] <= amountInMax,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        //(,,to)
        _swap(amounts, path, to);
    }

    /**
     * @dev ATPtoken
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapExactATPForTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable ensure(deadline) returns (uint256[] memory amounts) {
        //WATP
        require(path[0] == WATP, "UniswapV2Router: INVALID_PATH");
        //  ((msg.value * 997 * Out) / (In * 1000 + msg.value * 997))
        amounts = UniswapV2Library.getAmountsOut(factory, msg.value, path);
        //>=
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        //[0]ATPWATP
        IWATP(WATP).deposit.value(amounts[0])();
        //[0]WATP(0,1)pair
        assert(
            IWATP(WATP).transfer(
                UniswapV2Library.pairFor(factory, path[0], path[1]),
                amounts[0]
            )
        );
        //(,,to)
        _swap(amounts, path, to);
    }

    /**
     * @dev tokenATP
     * @param amountOut 
     * @param amountInMax 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapTokensForExactATP(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external ensure(deadline) returns (uint256[] memory amounts) {
        //WATP
        require(path[path.length - 1] == WATP, "UniswapV2Router: INVALID_PATH");
        //  ((In * Out * 1000) / (Out -  * 997) + 1)
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        //<=
        require(
            amounts[0] <= amountInMax,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        //(,,)
        _swap(amounts, path, address(this));
        //WATPATP
        IWATP(WATP).withdraw(amounts[amounts.length - 1]);
        //ATPto
        TransferHelper.safeTransferATP(to, amounts[amounts.length - 1]);
    }

    /**
     * @dev tokenATP
     * @param amountIn 
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapExactTokensForATP(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external ensure(deadline) returns (uint256[] memory amounts) {
        //WATP
        require(path[path.length - 1] == WATP, "UniswapV2Router: INVALID_PATH");
        //  (( * 997 * Out) / (In * 1000 +  * 997))
        amounts = UniswapV2Library.getAmountsOut(factory, amountIn, path);
        //>=
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        //(,,)
        _swap(amounts, path, address(this));
        //WATPATP
        IWATP(WATP).withdraw(amounts[amounts.length - 1]);
        //ATPto
        TransferHelper.safeTransferATP(to, amounts[amounts.length - 1]);
    }

    /**
     * @dev ATPtoken
     * @param amountOut 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapATPForExactTokens(
        uint256 amountOut,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable ensure(deadline) returns (uint256[] memory amounts) {
        //WATP
        require(path[0] == WATP, "UniswapV2Router: INVALID_PATH");
        //  ((In * Out * 1000) / (Out -  * 997) + 1)
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        //<=msg.value
        require(
            amounts[0] <= msg.value,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        //[0]ATPWATP
        IWATP(WATP).deposit.value(amounts[0])();
        //[0]WATP(0,1)pair
        assert(
            IWATP(WATP).transfer(
                UniswapV2Library.pairFor(factory, path[0], path[1]),
                amounts[0]
            )
        );
        //(,,to)
        _swap(amounts, path, to);
        //``>`[0]` ``-`[0]`
        if (msg.value > amounts[0])
            TransferHelper.safeTransferATP(msg.sender, msg.value - amounts[0]); // refund dust atp, if any
    }

    function quote(
        uint256 amountA,
        uint256 reserveA,
        uint256 reserveB
    ) public pure returns (uint256 amountB) {
        return UniswapV2Library.quote(amountA, reserveA, reserveB);
    }

    // **** LIBRARY FUNCTIONS ****
    function getAmountOut(
        uint256 amountIn,
        uint256 reserveIn,
        uint256 reserveOut
    ) public pure returns (uint256 amountOut) {
        return UniswapV2Library.getAmountOut(amountIn, reserveIn, reserveOut);
    }

    function getAmountIn(
        uint256 amountOut,
        uint256 reserveIn,
        uint256 reserveOut
    ) public pure returns (uint256 amountIn) {
        return UniswapV2Library.getAmountOut(amountOut, reserveIn, reserveOut);
    }

    function getAmountsOut(uint256 amountIn, address[] memory path)
        public
        view
        returns (uint256[] memory amounts)
    {
        return UniswapV2Library.getAmountsOut(factory, amountIn, path);
    }

    function getAmountsIn(uint256 amountOut, address[] memory path)
        public
        view
        returns (uint256[] memory amounts)
    {
        return UniswapV2Library.getAmountsIn(factory, amountOut, path);
    }
}

